      returnType: null,
      doc: '<p>Adds a cookie to currently active browser context.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>name</code></td>\n<td>Name of the cookie.</td>\n</tr>\n<tr>\n<td><code>value</code></td>\n<td>Given value for the cookie.</td>\n</tr>\n<tr>\n<td><code>url</code></td>\n<td>Given url for the cookie. Defaults to None. Either <code>url</code> or <code>domain</code> / <code>path</code> pair must be set.</td>\n</tr>\n<tr>\n<td><code>domain</code></td>\n<td>Given domain for the cookie. Defaults to None. Either <code>url</code> or <code>domain</code> / <code>path</code> pair must be set.</td>\n</tr>\n<tr>\n<td><code>path</code></td>\n<td>Given path for the cookie. Defaults to None. Either <code>url</code> or <code>domain</code> / <code>path</code> pair must be set.</td>\n</tr>\n<tr>\n<td><code>expires</code></td>\n<td>Given expiry for the cookie. Can be of date format or unix time. Supports the same formats as the <a href="http://robotframework.org/robotframework/latest/libraries/DateTime.html">DateTime</a> library or an epoch timestamp. - example: 2027-09-28 16:21:35</td>\n</tr>\n<tr>\n<td><code>httpOnly</code></td>\n<td>Sets the httpOnly token.</td>\n</tr>\n<tr>\n<td><code>secure</code></td>\n<td>Sets the secure token.</td>\n</tr>\n<tr>\n<td><code>samesite</code></td>\n<td>Sets the samesite mode.</td>\n</tr>\n</table>\n<p>Example:</p>\n<pre>\n<a href="#Add%20Cookie" class="name">Add Cookie</a>   foo   bar   <a href="http://address.com/path/to/site">http://address.com/path/to/site</a>                                     # Using url argument.\n<a href="#Add%20Cookie" class="name">Add Cookie</a>   foo   bar   domain=example.com                path=/foo/bar                     # Using domain and url arguments.\n<a href="#Add%20Cookie" class="name">Add Cookie</a>   foo   bar   <a href="http://address.com/path/to/site">http://address.com/path/to/site</a>   expiry=2027-09-28 16:21:35        # Expiry as timestamp.\n<a href="#Add%20Cookie" class="name">Add Cookie</a>   foo   bar   <a href="http://address.com/path/to/site">http://address.com/path/to/site</a>   expiry=1822137695                 # Expiry as epoch seconds.\n</pre>\n<p><a href="https://forum.robotframework.org/t//4233">Comment &gt;&gt;</a></p>',
