      returnType: null,
      doc: '<p>Simulates mouse click on the element found by <code>selector</code>.</p>\n<p>This keyword clicks an element matching <code>selector</code> by performing the following steps:</p>\n<ul>\n<li>Find an element matches selector. If there is none, wait until a matching element is attached to the DOM.</li>\n<li>Wait for actionability checks on the matched element, unless <code>force</code> option is set. If the element is detached during the checks, the whole action is retried.</li>\n<li>Scroll the element into view if needed.</li>\n<li>Use <a href="#Mouse%20Button" class="name">Mouse Button</a> to click in the center of the element, or the specified position.</li>\n<li>Wait for initiated navigation to either succeed or fail, unless <code>noWaitAfter</code> option is set.</li>\n</ul>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>selector</code></td>\n<td>Selector element to click. See the <a href="#Finding%20elements" class="name">Finding elements</a> section for details about the selectors.</td>\n</tr>\n<tr>\n<td><code>button</code></td>\n<td>Defaults to <code>left</code> if invalid.</td>\n</tr>\n<tr>\n<td><code>*modifiers</code></td>\n<td>Modifier keys to press. Ensures that only these modifiers are pressed during the click, and then restores current modifiers back. If not specified, currently pressed modifiers are used. Modifiers can be specified in any order, and multiple modifiers can be specified. Valid modifier keys are <code>Control</code>, <code>Alt</code>, <code>Shift</code> and <code>Meta</code>. Due to the fact that the argument <span class="name">*modifiers</span> is a positional only argument, all preceding keyword arguments have to be specified as positional arguments before <span class="name">*modifiers</span>.</td>\n</tr>\n<tr>\n<td><code>clickCount</code></td>\n<td>Defaults to 1.</td>\n</tr>\n<tr>\n<td><code>delay</code></td>\n<td>Time to wait between mouse-down and mouse-up. Defaults to 0.</td>\n</tr>\n<tr>\n<td><code>position_x</code> <code>position_y</code></td>\n<td>A point to click relative to the top-left corner of element bounding-box. Only positive values within the bounding-box are allowed. If not specified, clicks to some visible point of the element.</td>\n</tr>\n<tr>\n<td><code>force</code></td>\n<td>Set to True to skip Playwright\'s Actionability checks (<a href="https://playwright.dev/docs/actionability">https://playwright.dev/docs/actionability</a>).</td>\n</tr>\n<tr>\n<td><code>noWaitAfter</code></td>\n<td>Actions that initiate navigation, are waiting for these navigation to happen and for pages to start loading. You can opt out of waiting via setting this flag. You would only need this option in the exceptional cases such as navigating to inaccessible pages. Defaults to <code>False</code>.</td>\n</tr>\n<tr>\n<td><code>trial</code></td>\n<td>When set, this method only performs the actionability checks and skips the action. Defaults to false. Useful to wait until the element is ready for the action without performing it.</td>\n</tr>\n</table>\n<p>Arguments <code>clickCount</code>, <code>delay</code>, <code>position_x</code>, <code>position_y</code>, <code>force</code>, <code>noWaitAfter</code> and <code>trial</code> are named-only arguments and must be specified using their names..</p>\n<p>Keyword uses strict mode, see <a href="#Finding%20elements" class="name">Finding elements</a> for more details about strict mode.</p>\n<p>Example:</p>\n<pre>\n<a href="#Click%20With%20Options" class="name">Click With Options</a>    id=button_location\n<a href="#Click%20With%20Options" class="name">Click With Options</a>    id=button_location    trial=True\n<a href="#Click%20With%20Options" class="name">Click With Options</a>    \\#clickWithOptions    delay=100ms    clickCount=2\n<a href="#Click%20With%20Options" class="name">Click With Options</a>    id=clickWithModifiers    left     Alt    Meta    Shift    clickCount=1    force=True\n<a href="#Click%20With%20Options" class="name">Click With Options</a>    id=clickWithOptions    right    clickCount=2    force=True    noWaitAfter=True\n</pre>\n<p><a href="https://forum.robotframework.org/t//5936">Comment &gt;&gt;</a></p>',
