      returnType: null,
      doc: '<p>Connect to a Playwright browser server via playwright websocket or Chrome DevTools Protocol.</p>\n<p>See <a href="#Launch%20Browser%20Server" class="name">Launch Browser Server</a> for more information about how to launch a playwright browser server.</p>\n<p>See <a href="#Browser%2C%20Context%20and%20Page" class="name">Browser, Context and Page</a> for more information about Browser and related concepts.</p>\n<p>Returns a stable identifier for the connected browser.</p>\n<table border="1">\n<tr>\n<th>Argument</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>wsEndpoint</code></td>\n<td>Address to connect to. Either <code>ws://</code> or <code>http://</code> if cdp is used.</td>\n</tr>\n<tr>\n<td><code>browser</code></td>\n<td>Opens the specified browser. Defaults to <code>chromium</code>.</td>\n</tr>\n<tr>\n<td><code>use_cdp</code></td>\n<td>Connect to browser via Chrome DevTools Protocol. Defaults to False. Works only with Chromium based browsers.</td>\n</tr>\n</table>\n<p>To Connect to a Browser viw Chrome DevTools Protocol, the browser must be started with this protocol enabled. This typically done by starting a Chrome browser with the argument <code>--remote-debugging-port=9222</code> or similar. When the browser is running with activated CDP, it is possible to connect to it either with websockets (<code>ws://</code>) or via HTTP (<code>http://</code>). The HTTP connection can be used when <code>use_cdp</code> is set to True. A typical address for a CDP connection is <code>http://127.0.0.1:9222</code>.</p>\n<p><a href="https://forum.robotframework.org/t//4242">Comment &gt;&gt;</a></p>',
