      returnType: null,
      doc: '<p>Executes a Drag&amp;Drop operation from the element selected by <code>selector_from</code> to the element selected by <code>selector_to</code>.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>selector_from</code></td>\n<td>Identifies the element, which center is the start-point.</td>\n</tr>\n<tr>\n<td><code>selector_to</code></td>\n<td>Identifies the element, which center is the end-point.</td>\n</tr>\n<tr>\n<td><code>steps</code></td>\n<td>Defines how many intermediate mouse move events are sent. Often it is nessesary to send more than one intermediate event to get the desired result. Defaults to 1.</td>\n</tr>\n</table>\n<p>See the <a href="#Finding%20elements" class="name">Finding elements</a> section for details about the selectors.</p>\n<p>First it moves the mouse to the start-point, then presses the left mouse button, then moves to the end-point in specified number of steps, then releases the mouse button.</p>\n<p>Start- and end-point are defined by the center of the elements boundingbox.</p>\n<p>Keyword uses strict mode, see <a href="#Finding%20elements" class="name">Finding elements</a> for more details about strict mode.</p>\n<p>Example</p>\n<pre>\n<a href="#Drag%20And%20Drop" class="name">Drag And Drop</a>    "Circle"    "Goal"\n</pre>\n<p><a href="https://forum.robotframework.org/t//4247">Comment &gt;&gt;</a></p>',
