      returnType: null,
      doc: '<p>Executes a Drag&amp;Drop operation from a coordinate to another coordinate.</p>\n<p>First it moves the mouse to the start-point, then presses the left mouse button, then moves to the end-point in specified number of steps, then releases the mouse button.</p>\n<p>Start- and end-point are defined by <code>x</code> and <code>y</code> coordinates relative to the top left corner of the pages viewport.</p>\n<table border="1">\n<tr>\n<td><code>from_x</code> &amp; <code>from_y</code></td>\n<td>Identify the start-point on page.</td>\n</tr>\n<tr>\n<td><code>to_x</code> &amp; <code>to_y</code></td>\n<td>Identify the end-point.</td>\n</tr>\n<tr>\n<td><code>steps</code></td>\n<td>Defines how many intermediate mouse move events are sent. Often it is nessesary to send more than one intermediate event to get the desired result. Defaults to 1.</td>\n</tr>\n</table>\n<p>Example:</p>\n<pre>\n<a href="#Drag%20And%20Drop%20By%20Coordinates" class="name">Drag And Drop By Coordinates</a>\n...    from_x=30    from_y=30\n...    to_x=10    to_y=10    steps=20\n</pre>\n<p><a href="https://forum.robotframework.org/t//4248">Comment &gt;&gt;</a></p>',
