      returnType: null,
      doc: '<p>Executes a Drag&amp;Drop operation from the element selected by <code>selector_from</code> to coordinates relative to the center of that element.</p>\n<p>This keyword can be handy to simulate swipe actions.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>selector_from</code></td>\n<td>identifies the element, which center is the start-point.</td>\n</tr>\n<tr>\n<td><code>x</code> &amp; <code>y</code></td>\n<td>identifies the end-point which is relative to the start-point.</td>\n</tr>\n<tr>\n<td><code>steps</code></td>\n<td>defines how many intermediate mouse move events are sent. Often it is nessesary to send more than one intermediate event to get the desired result. Defaults to 1.</td>\n</tr>\n</table>\n<p>See the <a href="#Finding%20elements" class="name">Finding elements</a> section for details about the selectors.</p>\n<p>First it moves the mouse to the start-point (center of boundingbox), then presses the left mouse button, then moves to the relative position with the given intermediate steps, then releases the mouse button.</p>\n<p>Keyword uses strict mode, see <a href="#Finding%20elements" class="name">Finding elements</a> for more details about strict mode.</p>\n<p>Example</p>\n<pre>\n<a href="#Drag%20And%20Drop%20Relative%20To" class="name">Drag And Drop Relative to</a>    "Circle"    -20    0     # Slides the element 20 pixel to the left\n</pre>\n<p><a href="https://forum.robotframework.org/t//4249">Comment &gt;&gt;</a></p>',
