      doc: '<p>Gets elements size and location as an object <code>{x: float, y: float, width: float, height: float}</code>.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>selector</code></td>\n<td>Selector from which shall be retrieved. See the <a href="#Finding%20elements" class="name">Finding elements</a> section for details about the selectors.</td>\n</tr>\n<tr>\n<td><code>key</code></td>\n<td>Optionally filters the returned values. If keys is set to <code>ALL</code> (default) it will return the BoundingBox as Dictionary, otherwise it will just return the single value selected by the key. Note: If a single value is retrieved, an assertion does <b>not</b> need a <code>validate</code> combined with a cast of <code>value</code>.</td>\n</tr>\n<tr>\n<td><code>assertion_operator</code></td>\n<td>See <a href="#Assertions" class="name">Assertions</a> for further details. Defaults to None.</td>\n</tr>\n<tr>\n<td><code>assertion_expected</code></td>\n<td>Expected value for the counting</td>\n</tr>\n<tr>\n<td><code>message</code></td>\n<td>overrides the default error message for assertion.</td>\n</tr>\n</table>\n<p>Keyword uses strict mode, see <a href="#Finding%20elements" class="name">Finding elements</a> for more details about strict mode.</p>\n<p>Optionally asserts that the value matches the specified assertion. See <a href="#Assertions" class="name">Assertions</a> for further details for the assertion arguments. By default assertion is not done.</p>\n<p>Example use:</p>\n<pre>\n${bounding_box}=    <a href="#Get%20BoundingBox" class="name">Get BoundingBox</a>    id=element                 # unfiltered\nLog                 ${bounding_box}                                 # {\'x\': 559.09375, \'y\': 75.5, \'width\': 188.796875, \'height\': 18}\n${x}=               <a href="#Get%20BoundingBox" class="name">Get BoundingBox</a>    id=element    x            # filtered\nLog                 X: ${x}                                         # X: 559.09375\n# Assertions:\n<a href="#Get%20BoundingBox" class="name">Get BoundingBox</a>     id=element         width         &gt;    180\n<a href="#Get%20BoundingBox" class="name">Get BoundingBox</a>     id=element         ALL           validate    value[\'x\'] &gt; value[\'y\']*2\n</pre>\n<p><a href="https://forum.robotframework.org/t//4258">Comment &gt;&gt;</a></p>',
