      doc: '<p>Returns all browsers, open contexts in them and open pages in these contexts.</p>\n<p>See <a href="#Browser%2C%20Context%20and%20Page" class="name">Browser, Context and Page</a> for more information about these concepts.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td>assertion_operator</td>\n<td>Optional assertion operator. See <a href="#Assertions" class="name">Assertions</a> for more information.</td>\n</tr>\n<tr>\n<td>assertion_expected</td>\n<td>Optional expected value. See <a href="#Assertions" class="name">Assertions</a> for more information.</td>\n</tr>\n<tr>\n<td>message</td>\n<td>Optional custom message to use on failure. See <a href="#Assertions" class="name">Assertions</a> for more information.</td>\n</tr>\n</table>\n<p>The data is parsed into a python list containing data representing the open Objects.</p>\n<p>On the root level the data contains a list of open browsers.</p>\n<p>Data can be manipulated also with <code>assertion_operator</code> for example to find a specific id based on index or page title with <code>then</code> operator.</p>\n<p>Return value can also be asserted against expected value.</p>\n<p>Sample:</p>\n<pre>\n[\n  {\n    "type": "chromium",\n    "id": "browser=96207191-8147-44e7-b9ac-5e04f2709c1d",\n    "contexts": [\n      {\n        "type": "context",\n        "id": "context=525d8e5b-3c4e-4baa-bfd4-dfdbc6e86089",\n        "activePage": "page=f90c97b8-eaaf-47f2-98b2-ccefd3450f12",\n        "pages": [\n          {\n            "type": "page",\n            "title": "Robocorp",\n            "url": "<a href="https://robocorp.com/">https://robocorp.com/</a>",\n            "id": "page=7ac15782-22d2-48b4-8591-ff17663fa737",\n            "timestamp": 1598607713.858\n          },\n          {\n            "type": "page",\n            "title": "Home - Reaktor",\n            "url": "<a href="https://www.reaktor.com/">https://www.reaktor.com/</a>",\n            "id": "page=f90c97b8-eaaf-47f2-98b2-ccefd3450f12",\n            "timestamp": 1598607714.702\n          }\n        ]\n      }\n    ],\n    "activeContext": "context=525d8e5b-3c4e-4baa-bfd4-dfdbc6e86089",\n    "activeBrowser": false\n  },\n  {\n    "type": "firefox",\n    "id": "browser=ad99abac-17a9-472b-ac7f-d6352630834e",\n    "contexts": [\n      {\n        "type": "context",\n        "id": "context=bc64f1ba-5e76-46dd-9735-4bd344afb9c0",\n        "activePage": "page=8baf2991-5eaf-444d-a318-8045f914e96a",\n        "pages": [\n          {\n            "type": "page",\n            "title": "Software-Qualit\u00e4tssicherung und Softwaretest",\n            "url": "<a href="https://www.imbus.de/">https://www.imbus.de/</a>",\n            "id": "page=8baf2991-5eaf-444d-a318-8045f914e96a",\n            "timestamp": 1598607716.828\n          }\n        ]\n      }\n    ],\n    "activeContext": "context=bc64f1ba-5e76-46dd-9735-4bd344afb9c0",\n    "activeBrowser": true\n  }\n]\n</pre>\n<p><a href="https://forum.robotframework.org/t//4259">Comment &gt;&gt;</a></p>',
