      doc: '<p>Returns information of cookie with <code>name</code> as a Robot Framework dot dictionary or a string.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>cookie</code></td>\n<td>Name of the cookie to be retrieved.</td>\n</tr>\n<tr>\n<td><code>return_type</code></td>\n<td>Type of the return value. Can be either <code>dictionary</code> or <code>string</code>. Defaults to <code>dictionary</code>.</td>\n</tr>\n</table>\n<p>If <code>return_type</code> is <code>dictionary</code> or <code>dict</code> then keyword returns a of Robot Framework <a href="https://robotframework.org/robotframework/latest/RobotFrameworkUserGuide.html#accessing-list-and-dictionary-items">dot dictionary</a> The dictionary contains all possible key value pairs of the cookie. If <code>return_type</code> is <code>string</code> or <code>str</code>, then keyword returns the cookie as a string in format: <code>name1=value1</code>. The return value contains only <code>name</code> and <code>value</code> keys of the cookie.</p>\n<p>If no cookie is found with <code>name</code> keyword fails. The cookie dictionary contains details about the cookie. Keys available in the dictionary are documented in the table below.</p>\n<table border="1">\n<tr>\n<td><b>Value</b></td>\n<td><b>Explanation</b></td>\n</tr>\n<tr>\n<td>name</td>\n<td>The name of a cookie, mandatory.</td>\n</tr>\n<tr>\n<td>value</td>\n<td>Value of the cookie, mandatory.</td>\n</tr>\n<tr>\n<td>url</td>\n<td>Define the scope of the cookie, what URLs the cookies should be sent to.</td>\n</tr>\n<tr>\n<td>domain</td>\n<td>Specifies which hosts are allowed to receive the cookie.</td>\n</tr>\n<tr>\n<td>path</td>\n<td>Indicates a URL path that must exist in the requested URL, for example <span class="name">/</span>.</td>\n</tr>\n<tr>\n<td>expiry</td>\n<td>Lifetime of a cookie. Returned as datatime object or None if not valid time received.</td>\n</tr>\n<tr>\n<td>httpOnly</td>\n<td>When true, the cookie is not accessible via JavaScript.</td>\n</tr>\n<tr>\n<td>secure</td>\n<td>When true, the cookie is only used with HTTPS connections.</td>\n</tr>\n<tr>\n<td>sameSite</td>\n<td>Attribute lets servers require that a cookie shouldn\'t be sent with cross-origin requests.</td>\n</tr>\n</table>\n<p>See <a href="https://playwright.dev/docs/api/class-browsercontext#browsercontextaddcookiescookies">playwright documentation</a> for details about each attribute.</p>\n<p>Example:</p>\n<pre>\n${cookie}=        <a href="#Get%20Cookie" class="name">Get Cookie</a>              Foobar\nShould Be Equal   ${cookie.value}           Tidii\nShould Be Equal   ${cookie.expiry.year}     ${2020}\n</pre>\n<p><a href="https://forum.robotframework.org/t//4265">Comment &gt;&gt;</a></p>',
