      doc: '<p>Returns the Web Element that has the same column index and same row index as the selected elements.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>table</code></td>\n<td>selector must select the <code>&lt;table&gt;</code> element that contains both selected elements</td>\n</tr>\n<tr>\n<td><code>column</code></td>\n<td>selector can select any <code>&lt;th&gt;</code> or <code>&lt;td&gt;</code> element or one of their descendants.</td>\n</tr>\n<tr>\n<td><code>row</code></td>\n<td>selector can select any <code>&lt;tr&gt;</code> element or one of their descendant like <code>&lt;td&gt;</code> elements.</td>\n</tr>\n</table>\n<p><code>column</code> and <code>row</code> can also consume index numbers instead of selectors. Indexes are starting from <code>0</code> and <code>-1</code> is specific for the last element.</p>\n<p>Selectors for <code>column</code> and <code>row</code> are directly appended to <code>table</code> selector like this: <code>f"{table} &gt;&gt; {row}" .</code></p>\n<table border="1">\n<tr>\n<th>GitHub</th>\n<th>Slack</th>\n<th>Real Name</th>\n</tr>\n<tr>\n<td>mkorpela</td>\n<td>@mkorpela</td>\n<td>Mikko Korpela</td>\n</tr>\n<tr>\n<td>aaltat</td>\n<td>@aaltat</td>\n<td>Tatu Aalto</td>\n</tr>\n<tr>\n<td>xylix</td>\n<td>@Kerkko Pelttari</td>\n<td>Kerkko Pelttari</td>\n</tr>\n<tr>\n<td>Snooz82</td>\n<td>@Ren\u00e9</td>\n<td>Ren\u00e9 Rohner</td>\n</tr>\n</table>\n<p>Example:</p>\n<pre>\n${table}=    Set Variable    [id="Get Table Cell Element"] &gt;&gt; div.kw-docs table &gt;&gt; nth=1\n${e}=    <a href="#Get%20Table%20Cell%20Element" class="name">Get Table Cell Element</a>    ${table}    "Real Name"    "aaltat"   # Returns element with text <code>Tatu Aalto</code>\nGet Text    ${e}    ==    Tatu Aalto\n${e}=    <a href="#Get%20Table%20Cell%20Element" class="name">Get Table Cell Element</a>    ${table}    "Slack"    "Mikko Korpela"   # Returns element with text <code>@mkorpela</code>\nGet Text    ${e}    ==    @mkorpela\n${e}=    <a href="#Get%20Table%20Cell%20Element" class="name">Get Table Cell Element</a>    ${table}    "mkorpela"    "Kerkko Pelttari"   # column does not need to be in row 0\nGet Text    ${e}    ==    @mkorpela\n${e}=    <a href="#Get%20Table%20Cell%20Element" class="name">Get Table Cell Element</a>    ${table}    2    -1   # Index is also directly possible\nGet Text    ${e}    ==    Ren\u00e9 Rohner\n</pre>\n<p><a href="https://forum.robotframework.org/t//4282">Comment &gt;&gt;</a></p>',
