      returnType: null,
      doc: '<p>Adds a highlight to elements matched by the <code>selector</code>. Provides a style adjustment.</p>\n<p>Returns the number of highlighted elements. Keyword does not fail, if <span class="name">locator</span> matched zero elements in the page. Keyword does not scroll elements to viewport and highlighted element might be outside the viewport. Use <a href="#Scroll%20To%20Element" class="name">Scroll To Element</a> keyword to scroll element in viewport.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>selector</code></td>\n<td>Selectors which shall be highlighted. See the <a href="#Finding%20elements" class="name">Finding elements</a> section for details about the selectors.</td>\n</tr>\n<tr>\n<td><code>duration</code></td>\n<td>Sets for how long the selector shall be highlighted. Defaults to <code>5s</code> =&gt; 5 seconds.</td>\n</tr>\n<tr>\n<td><code>width</code></td>\n<td>Sets the width of the higlight border. Defaults to 2px.</td>\n</tr>\n<tr>\n<td><code>style</code></td>\n<td>Sets the style of the border. Defaults to dotted.</td>\n</tr>\n<tr>\n<td><code>color</code></td>\n<td>Sets the color of the border. Valid colors i.e. are: <code>red</code>, <code>blue</code>, <code>yellow</code>, <code>pink</code>, <code>black</code></td>\n</tr>\n</table>\n<p>Keyword does not fail if selector resolves to multiple elements.</p>\n<p>Example:</p>\n<pre>\n<a href="#Highlight%20Elements" class="name">Highlight Elements</a>    input#login_button    duration=200ms\n${count} =    <a href="#Highlight%20Elements" class="name">Highlight Elements</a>    input#login_button    duration=200ms    width=4px    style=solid    color=\\#FF00FF\nShould Be Equal    ${count}    ${5}\n</pre>\n<p><a href="https://forum.robotframework.org/t//4294">Comment &gt;&gt;</a></p>',
