      doc: '<p>Performs an HTTP request in the current browser context</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>url</code></td>\n<td>The request url, e.g. <code>/api/foo</code>.</td>\n</tr>\n<tr>\n<td><code>method</code></td>\n<td>The HTTP method for the request. Defaults to GET.</td>\n</tr>\n<tr>\n<td><code>body</code></td>\n<td>The request body. GET requests cannot have a body. If the body can be parsed as JSON, the <code>Content-Type</code> header for the request will be automatically set to <code>application/json</code>. Defaults to None.</td>\n</tr>\n<tr>\n<td><code>headers</code></td>\n<td>A dictionary of additional request headers. Defaults to None.</td>\n</tr>\n</table>\n<p>The response is a Python dictionary with following attributes:</p>\n<ul>\n<li><code>status</code> &lt;int&gt; The status code of the response.</li>\n<li><code>statusText</code> &lt;str&gt; Status text corresponding to <code>status</code>, e.g OK or INTERNAL SERVER ERROR. This may not be available for all browser.</li>\n<li><code>body</code> &lt;dict&gt; | &lt;str&gt; The response body. If the body can be parsed as a JSON obejct, it will be returned as Python dictionary, otherwise it is returned as a string.</li>\n<li><code>headers</code> &lt;dict&gt; A dictionary containing all response headers.</li>\n<li><code>ok</code> &lt;bool&gt; Whether the request was successfull, i.e. the <code>status</code> is range 200-299.</li>\n</ul>\n<p>Here\'s an example of using Robot Framework dictionary variables and extended variable syntax to do assertions on the response object:</p>\n<pre>\n&amp;{res}=             <a href="#Http" class="name">HTTP</a>                       /api/endpoint\nShould Be Equal     ${res.status}              200\nShould Be Equal     ${res.body.some_field}     some value\n</pre>\n<p><a href="https://forum.robotframework.org/t//4296">Comment &gt;&gt;</a></p>',
