      returnType: null,
      doc: '<p>Press a keyboard key on the virtual keyboard or set a key up or down.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>action</code></td>\n<td>Determine whether the key should be released (<code>up</code>), hold (<code>down</code>) or pressed once (<code>press</code>). <code>down</code> or <code>up</code> are useful for combinations i.e. with Shift.</td>\n</tr>\n<tr>\n<td><code>key</code></td>\n<td>The key to be pressed. An example of valid keys are: <code>F1</code> - <code>F12</code>, <code>Digit0</code> - <code>Digit9</code>, <code>KeyA</code> - <code>KeyZ</code>, <code>Backquote</code>, <code>Minus</code>, <code>Equal</code>, <code>Backslash</code>, <code>Backspace</code>, <code>Tab</code>, <code>Delete</code>, <code>Escape</code>, <code>ArrowDown</code>, <code>End</code>, <code>Enter</code>, <code>Home</code>, <code>Insert</code>, <code>PageDown</code>, <code>PageUp</code>, <code>ArrowRight</code>, <code>ArrowUp</code> , etc.</td>\n</tr>\n</table>\n<p>Useful keys for <code>down</code> and <code>up</code> for example are: <code>Shift</code>, <code>Control</code>, <code>Alt</code>, <code>Meta</code>, <code>ShiftLeft</code></p>\n<p>Example excecution:</p>\n<pre>\n<a href="#Keyboard%20Key" class="name">Keyboard Key</a>    press    S\n<a href="#Keyboard%20Key" class="name">Keyboard Key</a>    down     Shift\n<a href="#Keyboard%20Key" class="name">Keyboard Key</a>    press    ArrowLeft\n<a href="#Keyboard%20Key" class="name">Keyboard Key</a>    press    Delete\n<a href="#Keyboard%20Key" class="name">Keyboard Key</a>    up       Shift\n</pre>\n<p>Note: Capital letters don\'t need to be written by the help of Shift. You can type them in directly.</p>\n<p><a href="https://forum.robotframework.org/t//4298">Comment &gt;&gt;</a></p>',
