      doc: '<p>Instead of selectors command mouse with coordinates. The Click commands will leave the virtual mouse on the specified coordinates.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>x</code> &amp; <code>y</code></td>\n<td>Are absolute coordinates starting at the top left of the page.</td>\n</tr>\n<tr>\n<td><code>steps</code></td>\n<td>Number of intermediate steps for the mouse event. Often it is nessesary to send more than one intermediate event to get the desired result. Defaults to 1.</td>\n</tr>\n</table>\n<p>Example:</p>\n<pre>\n<a href="#Mouse%20Move" class="name">Mouse Move</a>    400    400\n</pre>\n<p><a href="https://forum.robotframework.org/t//4304">Comment &gt;&gt;</a></p>',
