      doc: '<p>Create a new playwright Browser with specified options.</p>\n<p>See <a href="#Browser%2C%20Context%20and%20Page" class="name">Browser, Context and Page</a> for more information about Browser and related concepts.</p>\n<p>Returns a stable identifier for the created browser.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>browser</code></td>\n<td>Opens the specified <a href="#type-SupportedBrowsers">browser</a>. Defaults to chromium.</td>\n</tr>\n<tr>\n<td><code>headless</code></td>\n<td>Set to False if you want a GUI. Defaults to True.</td>\n</tr>\n<tr>\n<td><code>args</code></td>\n<td>Additional arguments to pass to the browser instance. The list of Chromium flags can be found <a href="http://peter.sh/experiments/chromium-command-line-switches/">here</a>. Defaults to None.</td>\n</tr>\n<tr>\n<td><code>channel</code></td>\n<td>Allows to operate against the stock Google Chrome and Microsoft Edge browsers. For more details see: <a href="https://playwright.dev/docs/browsers#google-chrome--microsoft-edge">Playwright documentation</a>.</td>\n</tr>\n<tr>\n<td><code>chromiumSandbox</code></td>\n<td>Enable Chromium sandboxing. Defaults to False.</td>\n</tr>\n<tr>\n<td><code>devtools</code></td>\n<td>Chromium-only Whether to auto-open a Developer Tools panel for each tab.</td>\n</tr>\n<tr>\n<td><code>downloadsPath</code></td>\n<td>If specified, accepted downloads are downloaded into this folder. Otherwise, temporary folder is created and is deleted when browser is closed. Regarding file deletion, see the docs of <a href="#Download" class="name">Download</a> and <a href="#Promise%20To%20Wait%20For%20Download" class="name">Promise To Wait For Download</a>.</td>\n</tr>\n<tr>\n<td><code>env</code></td>\n<td>Specifies environment variables that will be visible to the browser. Dictionary keys are variable names, values are the content. Defaults to None.</td>\n</tr>\n<tr>\n<td><code>executablePath</code></td>\n<td>Path to a browser executable to run instead of the bundled one. If executablePath is a relative path, then it is resolved relative to current working directory. Note that Playwright only works with the bundled Chromium, Firefox or WebKit, use at your own risk. Defaults to None.</td>\n</tr>\n<tr>\n<td><code>firefoxUserPrefs</code> |Firefox user preferences. Learn more about the Firefox user preferences at <a href="https://support.mozilla.org/en-US/kb/about-config-editor-firefox">about:config</a>.</td>\n<td></td>\n</tr>\n<tr>\n<td><code>handleSIGHUP</code></td>\n<td>Close the browser process on SIGHUP. Defaults to True.</td>\n</tr>\n<tr>\n<td><code>handleSIGINT</code></td>\n<td>Close the browser process on Ctrl-C. Defaults to True.</td>\n</tr>\n<tr>\n<td><code>handleSIGTERM</code></td>\n<td>Close the browser process on SIGTERM. Defaults to True.</td>\n</tr>\n<tr>\n<td><code>ignoreDefaultArgs</code></td>\n<td>If True, Playwright does not pass its own configurations args and only uses the ones from args. If a list is given, then filters out the given default arguments. Dangerous option; use with care. Defaults to False.</td>\n</tr>\n<tr>\n<td><code>proxy</code></td>\n<td>Network <a href="#type-Proxy">Proxy</a> settings. Structure: <code>{\'server\': &lt;str&gt;, \'bypass\': &lt;Optional[str]&gt;, \'username\': &lt;Optional[str]&gt;, \'password\': &lt;Optional[str]&gt;}</code></td>\n</tr>\n<tr>\n<td><code>reuse_existing</code></td>\n<td>If set to True, an existing browser instance, that matches the same arguments, will be reused. If no same configured Browser exist, a new one is started. Defaults to True.</td>\n</tr>\n<tr>\n<td><code>slowMo</code></td>\n<td>Slows down Playwright operations by the specified amount of milliseconds. Useful so that you can see what is going on. Defaults to no delay.</td>\n</tr>\n<tr>\n<td><code>timeout</code></td>\n<td>Maximum time in Robot Framework time format to wait for the browser instance to start. Defaults to 30 seconds. Pass 0 to disable timeout.</td>\n</tr>\n</table>\n<p><a href="https://forum.robotframework.org/t//4306">Comment &gt;&gt;</a></p>',
