      doc: '<p>Create a new BrowserContext with specified options.</p>\n<p>See <a href="#Browser%2C%20Context%20and%20Page" class="name">Browser, Context and Page</a> for more information about BrowserContext.</p>\n<p>Returns a stable identifier for the created context that can be used in <a href="#Switch%20Context" class="name">Switch Context</a>.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>acceptDownloads</code></td>\n<td>Whether to automatically download all the attachments. Defaults to True where all the downloads are accepted.</td>\n</tr>\n<tr>\n<td><code>baseURL</code></td>\n<td>When using <a href="#Go%20To" class="name">Go To</a>, <a href="#Wait%20For%20Request" class="name">Wait For Request</a> or <a href="#Wait%20For%20Response" class="name">Wait For Response</a> it takes the base URL in consideration by using the URL() constructor for building the corresponding URL. Unset by default. Examples: <code>baseURL=http://localhost:3000</code> and navigating to <code>/bar.html</code> results in <code>http://localhost:3000/bar.html</code>. <code>baseURL=http://localhost:3000/foo/</code> and navigating to <code>./bar.html</code> results in <code>http://localhost:3000/foo/bar.html</code>. <code>baseURL=http://localhost:3000/foo</code> (without trailing slash) and navigating to <code>./bar.html</code> results in <code>http://localhost:3000/bar.html</code>.</td>\n</tr>\n<tr>\n<td><code>bypassCSP</code></td>\n<td>Toggles bypassing page\'s Content-Security-Policy. Defaults to False.</td>\n</tr>\n<tr>\n<td><code>colorScheme</code></td>\n<td>Emulates <span class="name">\'prefers-colors-scheme\'</span> media feature, supported values are <span class="name">\'light\'</span>, <span class="name">\'dark\'</span>, <span class="name">\'no-preference\'</span>.</td>\n</tr>\n<tr>\n<td><code>defaultBrowserType</code></td>\n<td>If no browser is open and <a href="#New%20Context" class="name">New Context</a> opens a new browser with defaults, it now uses this setting. Very useful together with <a href="#Get%20Device" class="name">Get Device</a> keyword.</td>\n</tr>\n<tr>\n<td><code>deviceScaleFactor</code></td>\n<td>Specify device scale factor (can be thought of as dpr). Defaults to <code>1</code>.</td>\n</tr>\n<tr>\n<td><code>extraHTTPHeaders</code></td>\n<td>A dictionary containing additional HTTP headers to be sent with every request. All header values must be strings.</td>\n</tr>\n<tr>\n<td><code>forcedColors</code></td>\n<td>Emulates <span class="name">forced-colors</span> media feature, supported values are <span class="name">active</span> and <a href="#type-None" class="name">none</a>.</td>\n</tr>\n<tr>\n<td><code>geolocation</code></td>\n<td>A dictionary containing <code>latitude</code> and <code>longitude</code> or <code>accuracy</code> to emulate. If <code>latitude</code> or <code>longitude</code> is not specified, the device geolocation won\'t be overriden.</td>\n</tr>\n<tr>\n<td><code>hasTouch</code></td>\n<td>Specifies if viewport supports touch events. Defaults to False.</td>\n</tr>\n<tr>\n<td><code>httpCredentials</code></td>\n<td>Credentials for <a href="https://developer.mozilla.org/en-US/docs/Web/HTTP/Authentication">HTTP authentication</a>.</td>\n</tr>\n<tr>\n<td><code>ignoreHTTPSErrors</code></td>\n<td>Whether to ignore HTTPS errors during navigation. Defaults to False.</td>\n</tr>\n<tr>\n<td><code>isMobile</code></td>\n<td>Whether the meta viewport tag is taken into account and touch events are enabled. Defaults to False.</td>\n</tr>\n<tr>\n<td><code>javaScriptEnabled</code></td>\n<td>Whether or not to enable JavaScript in the context. Defaults to True.</td>\n</tr>\n<tr>\n<td><code>locale</code></td>\n<td>Specify user locale, for example <code>en-GB</code>, <code>de-DE</code>, etc.</td>\n</tr>\n<tr>\n<td><code>offline</code></td>\n<td>Toggles browser\'s offline mode. Defaults to False.</td>\n</tr>\n<tr>\n<td><code>permissions</code></td>\n<td>A list containing permissions to grant to all pages in this context. All permissions that are not listed here will be automatically denied.</td>\n</tr>\n<tr>\n<td><code>proxy</code></td>\n<td>Network proxy settings to use with this context. Defaults to None. <b>NOTE:</b> For Chromium on Windows the browser needs to be launched with the global proxy for this option to work. If all contexts override the proxy, global proxy will be never used and can be any string, for example <code>proxy={ server: \'<a href="http://per-context">http://per-context</a>\' }</code>.</td>\n</tr>\n<tr>\n<td><code>recordHar</code></td>\n<td>Enables <a href="http://www.softwareishard.com/blog/har-12-spec/">HAR</a> recording for all pages into to a file. Must be path to file, example ${OUTPUT_DIR}/har.file. If not specified, the HAR is not recorded. Make sure to await context to close for the to be saved.</td>\n</tr>\n<tr>\n<td><code>recordVideo</code></td>\n<td>Enables video recording for all pages into a folder. If not specified videos are not recorded. Make sure to close context for videos to be saved. Video is not support in remote browsers.</td>\n</tr>\n<tr>\n<td><code>reduceMotion</code></td>\n<td>Emulates <span class="name">prefers-reduced-motion</span> media feature, supported values are <span class="name">reduce</span>, <span class="name">no-preference</span>.</td>\n</tr>\n<tr>\n<td><code>screen</code></td>\n<td>Emulates consistent window screen size available inside web page via window.screen. Is only used when the viewport is set. Example {\'width\': 414, \'height\': 896}</td>\n</tr>\n<tr>\n<td><code>serviceWorkers</code></td>\n<td>Whether to allow sites to register Service workers. Defaults to \'allow\'.</td>\n</tr>\n<tr>\n<td><code>storageState</code></td>\n<td>Restores the storage stated created by the <a href="#Save%20Storage%20State" class="name">Save Storage State</a> keyword. Must mbe full path to the file.</td>\n</tr>\n<tr>\n<td><code>timezoneId</code></td>\n<td>Changes the timezone of the context. See <a href="https://source.chromium.org/chromium/chromium/src/+/master:third_party/icu/source/data/misc/metaZones.txt">ICU`s metaZones.txt</a> for a list of supported timezone IDs.</td>\n</tr>\n<tr>\n<td><code>tracing</code></td>\n<td>File name where the <a href="https://playwright.dev/docs/api/class-tracing/">tracing</a> file is saved. Example trace.zip will be saved to ${OUTPUT_DIR}/traces.zip. Temporary trace files will be saved to ${OUTPUT_DIR}/Browser/traces. If file name is defined, tracing will be enabled for all pages in the context. Tracing is automatically closed when context is closed. Temporary trace files will be automatically deleted at start of each test execution. Trace file can be opened after the test execution by running command from shell: <code>rfbrowser show-trace /path/to/trace.zip</code>.</td>\n</tr>\n<tr>\n<td><code>userAgent</code></td>\n<td>Specific user agent to use in this context.</td>\n</tr>\n<tr>\n<td><code>viewport</code></td>\n<td>A dictionary containing <code>width</code> and <code>height</code>. Emulates consistent viewport for each page. Defaults to 1280x720. null disables the default viewport. If <code>width</code> and <code>height</code> is  <code>0</code>, the viewport will scale with the window.</td>\n</tr>\n</table>\n<p>Example:</p>\n<pre>\nTest an iPhone\n    ${device}=    <a href="#Get%20Device" class="name">Get Device</a>    iPhone X\n    <a href="#New%20Context" class="name">New Context</a>    &amp;{device}        # unpacking here with &amp;\n    <a href="#New%20Page" class="name">New Page</a>    <a href="http://example.com">http://example.com</a>\n</pre>\n<p>A BrowserContext is the Playwright object that controls a single browser profile. Within a context caches and cookies are shared. See <a href="https://playwright.dev/docs/api/class-browser#browsernewcontextoptions">Playwright browser.newContext</a> for a list of supported options.</p>\n<p>If there\'s no open Browser this keyword will open one. Does not create pages.</p>\n<p><a href="https://forum.robotframework.org/t//4307">Comment &gt;&gt;</a></p>',
