      doc: '<p>Takes a screenshot of the current window or element and saves it to disk.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>filename</code></td>\n<td>Filename into which to save. The file will be saved into the robot framework  ${OUTPUTDIR}/browser/screenshot directory by default, but it can be overwritten by providing custom path or filename. String <code>{index}</code> in filename will be replaced with a rolling  number. Use this to not override filenames. If filename equals to EMBED (case insensitive) or ${NONE},  then screenshot is embedded as Base64 image to the log.html. The image is saved temporally  to the disk and warning is displayed if removing the temporary file fails. The ${OUTPUTDIR}/browser/ is removed at the first suite startup.</td>\n</tr>\n<tr>\n<td><code>selector</code></td>\n<td>Take a screenshot of the element matched by selector. See the <a href="#Finding%20elements" class="name">Finding elements</a> section for details about the selectors. If not provided take a screenshot of current viewport.</td>\n</tr>\n<tr>\n<td><code>crop</code></td>\n<td>Crops the taken screenshot to the given box. It takes same dictionary as returned from <a href="#Get%20BoundingBox" class="name">Get BoundingBox</a>. Cropping only works on page screenshot, so if no selector is given.</td>\n</tr>\n<tr>\n<td><code>disableAnimations</code></td>\n<td>When set to <code>True</code>, stops CSS animations, CSS transitions and Web Animations. Animations get different treatment depending on their duration:  - finite animations are fast-forwarded to completion, so they\'ll fire transitionend event.  - infinite animations are canceled to initial state, and then played over after the screenshot.</td>\n</tr>\n<tr>\n<td><code>fileType</code></td>\n<td><code>png</code> or <code>jpeg</code> Specify screenshot type, defaults to <code>png</code> .</td>\n</tr>\n<tr>\n<td><code>fullPage</code></td>\n<td>When True, takes a screenshot of the full scrollable page, instead of the currently visible viewport. Defaults to False.</td>\n</tr>\n<tr>\n<td><code>log_screenshot</code></td>\n<td>When set to <code>False</code> the screenshot is taken but not logged into log.html.</td>\n</tr>\n<tr>\n<td><code>mask</code></td>\n<td>Specify selectors that should be masked when the screenshot is taken. Masked elements will be overlayed with a pink box <code>#FF00FF</code> that completely covers its bounding box. Argument can take a single selector string or a list of selector strings if multiple different elements should be masked.</td>\n</tr>\n<tr>\n<td><code>maskColor</code></td>\n<td>Specify the color of the overlay box for masked elements, in CSS color format. Default color is pink #FF00FF.</td>\n</tr>\n<tr>\n<td><code>omitBackground</code></td>\n<td>Hides default white background and allows capturing screenshots with transparency. Not applicable to jpeg images.</td>\n</tr>\n<tr>\n<td><code>quality</code></td>\n<td>The quality of the image, between 0-100. Not applicable to png images.</td>\n</tr>\n<tr>\n<td><code>scale</code></td>\n<td><code>css</code> or <code>device</code>. <code>css</code> will reduce the image size and <code>device</code> keeps image in original size. Defaults to <code>device</code>.</td>\n</tr>\n<tr>\n<td><code>return_as</code></td>\n<td>Defines what this keyword returns. Possible values are documented in <a href="#type-ScreenshotReturnType" class="name">ScreenshotReturnType</a>. It can be either a path to the screenshot file as string or Path object, or the image data as bytes or base64 encoded string.</td>\n</tr>\n<tr>\n<td><code>timeout</code></td>\n<td>Maximum time how long taking screenshot can last, defaults to library timeout. Supports Robot Framework time format, like 10s or 1 min, pass 0 to disable timeout. The default value can be changed by using the <a href="#Set%20Browser%20Timeout" class="name">Set Browser Timeout</a> keyword.</td>\n</tr>\n</table>\n<p>Keyword uses strict mode if selector is defined. See <a href="#Finding%20elements" class="name">Finding elements</a> for more details about strict mode.</p>\n<p>Example</p>\n<pre>\n<a href="#Take%20Screenshot" class="name">Take Screenshot</a>                                 # Takes screenshot from page with default filename\n<a href="#Take%20Screenshot" class="name">Take Screenshot</a>   selector=id=username_field    # Captures element in image\n# Takes screenshot with jpeg extension, defines image quality and timeout how long taking screenhost should last\n<a href="#Take%20Screenshot" class="name">Take Screenshot</a>   fullPage=True    fileType=jpeg    quality=50    timeout=10s\n<a href="#Take%20Screenshot" class="name">Take Screenshot</a>   EMBED                         # Screenshot is embedded as Base64 image to the log.html.\n</pre>\n<p><a href="https://forum.robotframework.org/t//4337">Comment &gt;&gt;</a></p>',
