      returnType: null,
      doc: '<p>Simulates tap on the element found by <code>selector</code>.</p>\n<p>Requires that the <code>hasTouch</code> option of the <a href="#New%20Context" class="name">New Context</a> be set to true. This method taps the element by performing the following steps:</p>\n<ul>\n<li>Wait for actionability checks on the element, unless force option is set.</li>\n<li>Scroll the element into view if needed.</li>\n<li>Use page.touchscreen to tap the center of the element, or the specified position.</li>\n<li>Wait for initiated navigations to either succeed or fail, unless noWaitAfter option is set.</li>\n</ul>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>selector</code></td>\n<td>Selector element to click. See the <a href="#Finding%20elements" class="name">Finding elements</a> section for details about the selectors.</td>\n</tr>\n<tr>\n<td><code>*modifiers</code></td>\n<td>Modifier keys to press. Ensures that only these modifiers are pressed during the click, and then restores current modifiers back. If not specified, currently pressed modifiers are used. Modifiers can be specified in any order, and multiple modifiers can be specified. Valid modifier keys are <code>Control</code>, <code>Alt</code>, <code>Shift</code> and <code>Meta</code>.</td>\n</tr>\n<tr>\n<td><code>force</code></td>\n<td>Whether to bypass the actionability checks. Defaults to false.</td>\n</tr>\n<tr>\n<td><code>noWaitAfter</code></td>\n<td>Actions that initiate navigations are waiting for these navigations to happen and for pages to start loading. You can opt out of waiting via setting this flag. You would only need this option in the exceptional cases such as navigating to inaccessible pages. Defaults to <code>False</code>.</td>\n</tr>\n<tr>\n<td><code>position_x</code> <code>position_y</code></td>\n<td>A point to click relative to the top-left corner of element bounding-box. Only positive values within the bounding-box are allowed. If not specified, clicks to some visible point of the element.</td>\n</tr>\n<tr>\n<td><code>trial</code></td>\n<td>When set, this method only performs the actionability checks and skips the action. Defaults to <code>False</code>.</td>\n</tr>\n</table>\n<p>Example:</p>\n<pre>\nNew Context    hasTouch=${False}\nNew Page    ${URL}\nTap    css=input#login_button\n</pre>\n<p><a href="https://forum.robotframework.org/t//5939">Comment &gt;&gt;</a></p>',
