      doc: '<p>Waits for a condition, defined with Browser getter keywords to become True.</p>\n<p>This Keyword is basically just a wrapper around our assertion keywords, but with a timeout. It can be used to wait for anything that also can be asserted with our keywords.</p>\n<p>In comparison to Robot Frameworks <span class="name">Wait Until Keywords Succeeds</span> this keyword is more readable and easier to use but is limited to Browser libraries assertion keywords.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>condition</code></td>\n<td>A condition, defined with Browser getter keywords, without the word <code>Get</code>.</td>\n</tr>\n<tr>\n<td><code>*args</code></td>\n<td>Arguments to pass to the condition keyword.</td>\n</tr>\n<tr>\n<td><code>timeout</code></td>\n<td>Timout to wait for the condition to become True. Uses default timeout of the library if not set.</td>\n</tr>\n<tr>\n<td><code>message</code></td>\n<td>Overrides the default error message.</td>\n</tr>\n</table>\n<p>The easiest way to use this keyword is first starting with an assertion keyword with assertion like: <a href="#Get%20Text" class="name">Get Text</a></p>\n<p>Start:</p>\n<pre>\n<a href="#Get%20Text" class="name">Get Text</a>    id=status_bar   contains    Done\n</pre>\n<p>Then you replace the word <span class="name">Get</span> with <a href="#Wait%20For%20Condition" class="name">Wait For Condition    </a> and if necessary add the timeout argument.</p>\n<p>End:</p>\n<pre>\n<a href="#Wait%20For%20Condition" class="name">Wait For Condition</a>    Text    id=status_bar   contains    Done\n</pre>\n<p>Example usage:</p>\n<pre>\n<a href="#Wait%20For%20Condition" class="name">Wait For Condition</a>    Element States    id=cdk-overlay-0    ==    detached\n<a href="#Wait%20For%20Condition" class="name">Wait For Condition</a>    Element States     //h1    contains    visible    editable    enabled    timeout=2 s\n<a href="#Wait%20For%20Condition" class="name">Wait For Condition</a>    Title    should start with    Robot\n<a href="#Wait%20For%20Condition" class="name">Wait For Condition</a>    Url    should end with    robotframework.org\n</pre>\n<p><a href="https://forum.robotframework.org/t//5269">Comment &gt;&gt;</a></p>',
