      doc: '<p><b>DEPRECATED!!</b> Use <a href="#Wait%20For%20Load%20State" class="name">Wait For Load State</a> instead.</p>\n<p>If you have:</p>\n<pre>\n<a href="#Wait%20Until%20Network%20Is%20Idle" class="name">Wait Until Network Is Idle</a>    timeout=3s\n</pre>\n<p>then chnnage it to:</p>\n<pre>\n<a href="#Wait%20For%20Load%20State" class="name">Wait For Load State</a>    networkidle    timeout=3s\n</pre>\n<p>Waits until there has been at least one instance of 500 ms of no network traffic on the page after loading.</p>\n<p>Doesn\'t wait for network traffic that wasn\'t initiated within 500ms of page load.</p>\n<table border="1">\n<tr>\n<th>Arguments</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>timeout</code></td>\n<td>Timeout supports Robot Framework time format. Uses browser timeout if not set.</td>\n</tr>\n</table>\n<p>Example:</p>\n<pre>\n<a href="#Go%20To" class="name">Go To</a>                         ${URL}\n<a href="#Wait%20Until%20Network%20Is%20Idle" class="name">Wait Until Network Is Idle</a>    timeout=3s\n</pre>\n<p><a href="https://forum.robotframework.org/t//4350">Comment &gt;&gt;</a></p>',
