      doc: "<p>Dictionary that contains information about a browser instance.</p>\n<table border=\"1\">\n<tr>\n<th>Key</th>\n<th>Description</th>\n</tr>\n<tr>\n<td><code>type</code></td>\n<td>The browser type. e.g. chromium, firefox or webkit.</td>\n</tr>\n<tr>\n<td><code>id</code></td>\n<td>The unique id of the browser instance.</td>\n</tr>\n<tr>\n<td><code>contexts</code></td>\n<td>List of context information opened by the browser.</td>\n</tr>\n<tr>\n<td><code>activeContext</code></td>\n<td>The id of the active context.</td>\n</tr>\n<tr>\n<td><code>activeBrowser</code></td>\n<td>Boolean if the browser is the currently active browser.</td>\n</tr>\n</table>\n<p>Structure:</p>\n<pre>\n{\n  'type': <span class=\"name\">str</span>,\n  'id': <span class=\"name\">str</span>,\n  'contexts': [\n      {\n          'type': <span class=\"name\">str</span>,\n          'id': <span class=\"name\">str</span>,\n          'activePage': <span class=\"name\">str</span>,\n          'pages': [\n              {\n                  'type': <span class=\"name\">str</span>,\n                  'title': <span class=\"name\">str</span>,\n                  'url': <span class=\"name\">str</span>,\n                  'id': <span class=\"name\">str</span>,\n                  'timestamp': <a href=\"#type-float\" class=\"name\">float</a>\n              },\n              ...\n          ]\n      },\n      ...\n  ],\n  'activeContext': <span class=\"name\">str</span>,\n  'activeBrowser': <span class=\"name\">bool</span>\n}\n</pre>",
